import React, { Component } from "react";

class MaterialItem extends Component {
  constructor(props) {
    super(props);
    console.log('material item: ', props);
    this.state = { 
      data: props.data,
      index: props.index
    };
  }

  render() {
    if (!this.state) {
      return null;
    }
    console.log('material item: ', this.state.data);
    console.log('material item: ', this.state.index);
    console.log('material item: ', this.state.notes);
    return (
      <div key={this.state.index + 1}>
        <h1>{this.state.data.name}</h1>
        <span className='material-notes'>{this.state.data.notes}</span>
        <span className='material-ds'>{this.state.data.datasheet_url}</span>
        <span className='material-tds'>{this.state.data.technicalinfosheet_url}</span>
      </div>
    )
  }
}

export default MaterialItem;
